import React, { useState } from "react";
import styled, { createGlobalStyle } from "styled-components";
import bgImage from "../assets/signup-bg.png";

import JoyM from "../assets/fonts/TJJoyofsingingM_TTF.ttf";
import DNFBitBitTTF from "../assets/fonts/DNFBitBitTTF.ttf";

// ===== 전역 폰트 등록 =====
const GlobalFonts = createGlobalStyle`
  @font-face {
    font-family: 'JoyM';
    src: url(${JoyM}) format('truetype');
    font-weight: normal;
    font-style: normal;
  }
  @font-face {
    font-family: 'DNFBitBitTTF';
    src: url(${DNFBitBitTTF}) format('truetype');
    font-weight: normal;
    font-style: normal;
  }
`;

export default function Signin() {
  const [id, setId] = useState("");
  const [isIdAvailable, setIsIdAvailable] = useState(null);
  const [password, setPassword] = useState("");
  const [passwordConfirm, setPasswordConfirm] = useState("");
  const [isPasswordMatch, setIsPasswordMatch] = useState(null);

  const checkIdAvailability = () => {
    if (id === "test") {
      setIsIdAvailable(false);
    } else {
      setIsIdAvailable(true);
    }
  };

  const handlePasswordConfirm = (value) => {
    setPasswordConfirm(value);
    setIsPasswordMatch(value === password && value.length > 0);
  };

  return (
    <>
      <GlobalFonts />
      <Container>
        <Title>회원가입</Title>

        <Form>
          <InputBox placeholder="닉네임" />

          <div>
            <InputBox placeholder="출생연도" inputMode="numeric" maxLength={4} />
            <Helper>예) 2004</Helper>
          </div>

          <div>
            <IdRow>
              <IdInput
                placeholder="아이디"
                value={id}
                onChange={(e) => setId(e.target.value)}
              />
              <CheckButton onClick={checkIdAvailability}>
                중복<br />확인
              </CheckButton>
            </IdRow>
            {isIdAvailable !== null && (
              <Helper style={{ color: isIdAvailable ? "#00CA98" : "#FF5656" }}>
                {isIdAvailable ? "사용 가능한 아이디입니다!" : "이미 사용 중입니다!"}
              </Helper>
            )}
          </div>

          <InputBox
            type="password"
            placeholder="비밀번호"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />

          <div>
            <InputBox
              type="password"
              placeholder="비밀번호 확인"
              value={passwordConfirm}
              onChange={(e) => handlePasswordConfirm(e.target.value)}
            />
            {isPasswordMatch !== null && (
              <Helper style={{ color: isPasswordMatch ? "#00CA98" : "#FF5656" }}>
                {isPasswordMatch ? "비밀번호가 일치합니다!" : "비밀번호가 일치하지 않습니다!"}
              </Helper>
            )}
          </div>

          <SignUpButton>가입하기</SignUpButton>
        </Form>
      </Container>
    </>
  );
}

/* ===== styled-components ===== */

const Container = styled.div`
  width: 393px;
  height: 852px;
  background: url(${bgImage}) no-repeat center center;
  background-size: contain;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 2.5rem 1.25rem;
  margin: 0 auto;
  font-family: 'JoyM', sans-serif; /* 전체 기본 폰트 */
`;

const Title = styled.h1`
  font-size: 3rem;
  color: #4CAF50;
  margin-top: 3.75rem;
`;

const Form = styled.div`
  width: 17.25rem;
  margin-top: 1.875rem;
  display: flex;
  align-items: center;
  flex-direction: column;
  gap: 1.875rem;
`;

const InputBox = styled.input`
  width: 17.25rem;
  height: 3rem;
  box-sizing: border-box;
  border: 0.125rem solid #8F8F8F;
  border-radius: 0.625rem;
  font-size: 1rem;
  padding-left: 1rem;
  outline: none;
`;

const Helper = styled.p`
  margin: 0;
  padding-top: 0.625rem;
  font-size: 1rem;
  text-align: left;
`;

const IdRow = styled.div`
  display: flex;
  align-items: center;
  gap: 0.3125rem;
`;

const IdInput = styled(InputBox)`
  width: 221px;
  flex: none;
`;

const CheckButton = styled.button`
  width: 50px;
  height: 3rem;
  background-color: #32885D;
  color: #fff;
  font-size: 0.8125rem;
  border: none;
  border-radius: 0.625rem;
  padding: 0;
  display: flex;
  align-items: center;
  justify-content: center;
  line-height: 1.1;
  text-align: center;
`;

const SignUpButton = styled.button`
  width: 217px;
  height: 58px;
  background-color: #66CE94;
  color: #fff;
  font-size: 32px;
  border: none;
  border-radius: 100px;
  cursor: pointer;
  margin-top: 30px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-family: 'DNFBitBitTTF';
`;
